import SocialItem from "./SocialItem";

function Social() {
    return (
        <ul className="list-group">
            <SocialItem
                p={{
                    media:'Facebook',
                    id:'facebook',
                    img:'https://picsum.photos/61',
                }}
            />
            <SocialItem
                    p={{
                        media:'Youtube',
                        id:'youtube',
                        img:'https://picsum.photos/61',
                    }}
            />
            <SocialItem
                p={{
                    media: 'Instgram',
                    id: 'instgram',
                    img: 'https://picsum.photos/61',
                }} />
              <SocialItem
                 p={{
                    media: 'LinkedIn',
                    id: 'linkedin',
                    img: 'https://picsum.photos/61',
                }} />
        
      
     </ul>
    )
}

export default Social;
